function lengthOfLongestSubstring(S){
	var myCurrentSubstring;
	var longestLength;
	for (index = 0; index< S.length; index++){
		if(myCurrentSubstring.Contains(S[index])){
			myCurrentSubstring = myCurrentSubstring.Substring(myCurrentSubstring.IndexOf(S[index] + 1))
			//This will move the string to the next position and delete the past substring 
		}
		myCurrentSubstring += S[index]
		longestLength = Math.Max(longestLength,myCurrentSubstring.length)
	}	
	return longestLength
}
 
