function longestPalindrome(s){ 
	var INDEX = 0;
    var RUNNER = INDEX+1;
    var HIGH = 0;
    var START, END= 0;
    
    while(INDEX < s.length){//Substring(startPOS, endPOS-1) 
    	var currentSubstring = s.substring(INDEX,RUNNER+1) 
        if(currentSubstring === currentSubstring.split("").reverse().join("")){
        	if(HIGH < currentSubstring.length){
        		START = INDEX
        		END = RUNNER
        		HIGH = currentSubstring.length
        	}
        }
        RUNNER++
        if(RUNNER > s.length){
        	INDEX++
        	RUNNER = INDEX+1
        }
    }
    return s.substring(START,END+1)
}

function add_two_arrays_backwards(numArray1, numArray2){
    var tempArry = []
    var carry = 0;
    for(var index = 0; index<numArray1.length;index++){
        var result = numArray1[index] + numArray2[index]
        if((result + carry) > 9){
            tempArry[index] = ((result + carry) % 10) + carry
            carry = 1
            continue
        }
    tempArry[index] = result + carry
    carry = 0
    }
    return tempArry
}

